{% endblock %}
{% block body %}
    <h1>User index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Username</th>
                <th>Roles</th>
                <th>Password</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td>{{ user.id }}</td>
                <td>{{ user.username }}</td>
                <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
                <td>{{ user.password }}</td>
                <td>
                    <a href=\"{{ path('user_show', {'id': user.id}) }}\"><button type=\"button\" class=\"btn btn-primary btn-sm\" >Show</button></a>
                    <a href=\"{{ path('user_edit', {'id': user.id}) }}\"><button type=\"button\" class=\"btn btn-primary btn-sm\" >Edit</button></a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"5\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('user_new') }}\"><button type=\"button\" class=\"btn btn-primary btn-sm\" >Create New</button></a>
    <br>
    <br>
    <br>
    <a class=\"button\" href=\"{{ url('index') }}\" style=\"display: block; text-align: center;\">Back To Home Page</a>


{% endblock %}
